Сухие и жидкие молочные смеси для искусственного вскармливания;
Молочные продукты для кормления грудью;
Безмолочные и безглютеновые продукты для детей с аллергией;
Каши, пюре, соки и другие продукты прикорма;
Витамины и минералы для детей разного возраста;
Товары для кормления, такие как бутылочки, соски, стерилизаторы и подогреватели;
Средства для купания, ухода за кожей и волосами ребенка;
Подгузники, пеленки и другие средства гигиены;
Детская посуда и столовые приборы.

Лютеин-интенсив:
обеспечивает максимальный уровень поступления в организм лютеина (10 мг в 2-х таблетках) и его накопление в сетчатке до физиологической нормы;
содержит зеаксантин, витамины А, В1, В2, В6, С, РР, цинк;
способствует защите сетчатки глаза и интенсивной поддержке зрения.
Комплекс биологически активных веществ Лютеин-интенсив способствует улучшению функционального состояния зрительного аппарата:

прием лютеина и зеаксантина приводит к их накоплению в сетчатке;
прием антиоксидантов (витамина А, витамина С, лютеина, зеаксантина, цинка) защищает хрусталик глаза от помутнения;
комплекс необходимых витаминов и антиоксидантов поддерживает метаболические процессы на клеточном уровне и способствует естественному поддержанию зрительных функций.

Показания

боли в спине при воспалительных и дегенеративных заболеваниях позвоночника (радикулит, остеоартроз, люмбаго, ишиас);
боли в суставах (в т.ч. суставы пальцев рук, коленные) при ревматоидном артрите, остеоартрозе;
боли в мышцах (вследствие растяжений, перенапряжений, ушибов, травм);
воспаление и отечность мягких тканей и суставов вследствие травм и при ревматических заболеваниях (тендовагинит, бурсит, поражения периартикулярных тканей, лучезапястный синдром).
